// src/Flow.js

import React, { useContext, useState, useCallback } from 'react';
import ReactFlow, {
  Background,
  Controls,
  Handle,
  Position,
  useReactFlow,
} from 'react-flow-renderer';
import { WorkflowContext } from './context/WorkflowContext';
import NodeOptions from './components/NodeOptions';
import PropertiesPanel from './components/PropertiesPanel';
import './styles.css';


const nodeTypes = {
  start: StartNode,
  task: TaskNode,
  decision: DecisionNode,
  end: EndNode,
};

// Custom node components
function StartNode({ data }) {
  return (
    <div className="node start">
      {data.label}
      <Handle type="source" position={Position.Bottom} />
    </div>
  );
}

function TaskNode({ data }) {
  return (
    <div className="node task">
      {data.label}
      <Handle type="source" position={Position.Bottom} />
      <Handle type="target" position={Position.Top} />
    </div>
  );
}

function DecisionNode({ data }) {
  return (
    <div className="node decision">
      {data.label}
      <Handle type="source" position={Position.Right} id="a" />
      <Handle type="source" position={Position.Left} id="b" />
      <Handle type="target" position={Position.Top} />
    </div>
  );
}

function EndNode({ data }) {
  return (
    <div className="node end">
      {data.label}
      <Handle type="target" position={Position.Top} />
    </div>
  );
}

const Flow = () => {
  const { nodes, edges, setNodes, setEdges } = useContext(WorkflowContext);
  const [selectedNode, setSelectedNode] = useState(null);
  const { fitView, zoomIn, zoomOut } = useReactFlow(); // Updated hook

  const onNodeClick = useCallback((event, node) => {
    setSelectedNode(node);
  }, []);

  const onPaneClick = useCallback(() => {
    setSelectedNode(null);
  }, []);

  const onNodesChange = (changes) => {
    setNodes((nds) =>
      nds.map((node) => {
        const change = changes.find((c) => c.id === node.id);
        return change ? { ...node, position: change.position } : node;
      })
    );
  };

  const onEdgesChange = (changes) => {
    // Implement if edge changes need to be handled
  };

  const onConnect = (params) => {
    setEdges((eds) => [...eds, { ...params, id: `${params.source}-${params.target}` }]);
  };

  const elements = [...nodes, ...edges];

  return (
    <div className="flow-container">
      <ReactFlow
        elements={elements}
        nodeTypes={nodeTypes}
        onElementClick={onNodeClick}
        onPaneClick={onPaneClick}
        snapToGrid={true}
        snapGrid={[15, 15]}
        style={{ width: '100%', height: '100%' }}
        onLoad={fitView}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
      >
        <Background color="#aaa" gap={16} />
        <Controls />
      </ReactFlow>
      {selectedNode && <NodeOptions node={selectedNode} />}
      {selectedNode && <PropertiesPanel node={selectedNode} />}
      {/* Zoom Controls */}
      <div style={{ position: 'absolute', top: 10, right: 10 }}>
        <button onClick={zoomIn} style={{ marginRight: '5px' }}>Zoom In</button>
        <button onClick={zoomOut}>Zoom Out</button>
      </div>
    </div>
  );
};

export default Flow;
